import React, { Component } from 'react'
import { Result, Button } from 'antd'
import UserHead from '../../../components/UserHead'

import MyNavLink from '../../../components/MyNavLink'

export default class Complete extends Component {

    state = {
        isSuccess: 0,
        data: []
    }

    componentDidMount() {
        const { isSuccess, orderNumbers } = this.props.history.location.state
        this.setState({ isSuccess, orderNumbers })
    }

    render() {
        const { isSuccess, data } = this.state
        return (
            <div>
                <UserHead />
                {
                    isSuccess === 1 ? <Result
                        status="success"
                        title="订票成功！"
                        subTitle={`订单编号: ${data.map((item) => {
                            return item
                        })}`}
                        extra={[
                            <MyNavLink to="/user/home/center">
                                <Button type="primary" key="console">
                                    个人中心
                                </Button>
                            </MyNavLink>
                            ,
                            <MyNavLink to="/user/search">
                                <Button key="buy">继续买票</Button>
                            </MyNavLink>,

                        ]}
                        style={{ marginTop: '100px' }}
                    />
                        :
                        <Result
                            status="success"
                            title="取消成功！"
                            subTitle={`订单编号: ${data[0]}`}
                            extra={[
                                <MyNavLink to="/user/home/center">
                                    <Button type="primary" key="console">
                                        个人中心
                                    </Button>
                                </MyNavLink>
                                ,
                                <MyNavLink to="/user/search">
                                    <Button key="buy">继续买票</Button>
                                </MyNavLink>,

                            ]}
                            style={{ marginTop: '100px' }}
                        />
                }

            </div>
        )
    }
}
